    <title>Eighth Page</title>
    <style>
        /* Basic CSS Reset */
        html, body {
            margin: 0;
            padding: 0;
            width: 100%;
            height: 100%;
            overflow: hidden; /* Prevents scrolling */
            display: flex;
            justify-content: center;
            align-items: center;
            background-color: #FBB03B; 
            position: relative; /* Needed for absolute positioning */
        }

        /* Stable SVG centered */
        #stable-svg {
            position: fixed;
            width: 800px; /* Adjust size as needed */
            height: auto;
            z-index: 2; /* Ensures it's above the clouds */
            top: 80px;
            left: 80px;        
        }

        /* Styles for floating frog */
        .car {
            position: absolute;
            width: 1200px; /* Adjust size as needed */
            height: auto;
            top: 0px;
            right: 0px;
            animation: float 5s infinite linear; /* Smooth floating effect */
            z-index: 1; /* Lower z-index to stay behind the main SVG */
        }

        /* Keyframes for floating clouds */
        @keyframes float {
            0% { transform: translateX(800px); }
            50% { transform: translateX(0px); } /* Moves cloud left and right */
            100% { transform: translateX(-1500px); }
        }

        /* Individual positioning */
        #cloud { bottom: 50%; right: 5%; }

        #END-text {
            position: absolute;
            bottom: 20px;
            left: 20px;
            font-family: Arial, sans-serif;
            font-size: 12px;
            color: #333;
            z-index: 20;
        }
    </style>
</head>
